-- Table structure for `t_region`
-- ----------------------------
DROP TABLE IF EXISTS `t_region`;
CREATE TABLE `t_region` (
  `ADDSID` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键标识',
  `code` int(11) NOT NULL COMMENT '行政区划代码，国标定义标准编码',
  `SuperiorCode` int(11) DEFAULT NULL COMMENT '上级代码',
  `name` varchar(128) NOT NULL COMMENT '行政区划名称',
  `type` smallint(6) NOT NULL COMMENT '类型 ：0、国家\r\n                   10、省 11、自治州 12、直辖市 13、特别行政区 \r\n                   20、地级市（包括普通地级市和副省级市） 21、地区 22、盟 23、自治州\r\n                   30、县 31、自治县 32、旗 33、自治旗 34、县级市 35、市辖区 36、林区 37、特区',
  `level` smallint(6) NOT NULL COMMENT '等级 ：0、国家 1、省  2、地市 3、区县',
  `isProvince` smallint(6) NOT NULL COMMENT '是否省会：0 否  1 是',
  `CityClassify` smallint(6) DEFAULT NULL COMMENT '1、一级城市 2、二级城市 3、三级城市 4、四级城市 5、五级城市 ',
  `Abb` varchar(64) NOT NULL COMMENT '简称',
  `SSP` varchar(64) NOT NULL COMMENT '短拼',
  `pinyin` varchar(128) NOT NULL COMMENT '拼音',
  `ProvinceCode` int(11) NOT NULL COMMENT '省代码，行政区划所属省代码',
  `ProvinceName` varchar(128) NOT NULL COMMENT '省名称，行政区划所属省',
  `ProvincePinYin` varchar(128) NOT NULL COMMENT '省拼音，行政区划所属省拼音',
  `CityCode` int(11) NOT NULL COMMENT '市代码',
  `CityName` varchar(128) NOT NULL COMMENT '市名称',
  `CityPinYin` varchar(128) NOT NULL COMMENT '市拼音',
  `AreaCode` int(11) NOT NULL COMMENT '区代码',
  `AreaName` varchar(128) NOT NULL COMMENT '区名称',
  `AreaPinYin` varchar(128) NOT NULL COMMENT '区拼音',
  `Status` smallint(6) NOT NULL COMMENT '状态',
  `CreateStaff` int(11) NOT NULL COMMENT '创建人员',
  `CreateTime` datetime NOT NULL COMMENT '创建时间',
  `UpdateStaff` int(11) NOT NULL COMMENT '修改人员',
  `UpdateTime` datetime NOT NULL COMMENT '修改时间',
  `IsDelete` smallint(6) NOT NULL COMMENT '是否删除',
  `DES` varchar(255) NOT NULL COMMENT '描述',
  PRIMARY KEY (`ADDSID`)
) ENGINE=InnoDB AUTO_INCREMENT=7368 DEFAULT CHARSET=utf8 COMMENT='行政区划表：用于记录中华人民共和国行政区划明细';

